sys_variable_value.value:
(function execute(inputs, outputs) {
  var payload = {};

  if(!gs.nil(inputs.type))
    payload.type =  inputs.type

    if(!gs.nil(inputs.domain))
      payload.domain =  inputs.domain;

  if(!gs.nil(inputs.zone))
    payload.zone= inputs.zone;

  if(!gs.nil(inputs.answers)){
    payload.answers = isJson(inputs.answers.toString())? JSON.parse(inputs.answers.toString()) :inputs.answers.toString();
  }

  outputs.payload = JSON.stringify(payload);

  function isJson(str) {
    try {
      JSON.parse(str);
    } catch (e) {
      return false;
    }
    return true;
  }

})(inputs, outputs);

